package main

import (
	"fmt"
	"log"

	"github.com/gocolly/colly"
)

func main() {
	c := colly.NewCollector(
		colly.AllowedDomains("tiktok.com"),
	)

	// Extract video links from the homepage feed (logged out)
	c.OnHTML(".video-feed-item", func(e *colly.HTMLElement) {
		videoLink := e.Attr("href")
		if len(videoLink) > 0 {
			log.Println(videoLink)
		}
	})

	c.Visit("https://www.tiktok.com/")
}

