Here's the code:
```goimport (
	"log"
	"fmt"

	"github.com/gocolly/colly"
)

// Define a struct to hold the scraped data 
type ScrapeResult struct {
	Username  string   `json:"username"`
 VideoID    string `json:"videoid"`
	Caption   string `json:"caption"`
	Tags      []string `json:"tags"`
}

func main() {
	// Initialize Colly collector 
	c := colly.NewCollector(
		colly.AllowedDomains("www.tiktok.com", "m.tiktok.com"),
	)

	// Scraping function for each video item 
	onItem := func(element *colly HTMLElement) {
		scrappedVideo := ScrapeResult{}

		// Extract video information 
		videoId := element.ChildAttr("video", "id")
		username := element.ChildText(".author-nickname")
		caption := element.ChildText(".desc")
		tags := []string{}
		element.ForEach(".tag-item > span > a", func(_ int, e *colly.HTMLElement) {
			tag := e.Text()
			tags = append(tags, tag)
		})

		// Store scrapped data into the ScrapeResult struct 
		scrappedVideo.VideoID = videoId 
		scrappedVideo.Username = username 
		scrappedVideo.Caption = caption 
		scrappedVideo.Tags = tags 

		fmt.Printf("[+] Scraped: Username -> %s\nVideo ID: %s\nCaption: %s \nTags: %v\n\n", scrappedVideo.Username, scrappedVideo.VideoID, scrappedVideo.Caption, scrappedVideo.Tags )
	}

	// Start scraping 
	err := c.OnHTML("li[data-type='video']", onItem).Visit("https://www.tiktok.com")
	if err!= nil {
		log.Fatal(err)
	}
}
